static int _on_extract_entry(const char *filename, void *arg)
{
    printf("[+] Extracted: %s\n", filename);

    return 0;
}

enum _extract_lib_ret_
{
    EXT_LIB_NORMAL = 0,
    EXT_LIB_ERR_RD_RES,
    EXT_LIB_ERR_CRE_ZIP,
    EXT_LIB_ERR_WR_ZIP,
    EXP_LIB_ERR_EXTRACT,
};
int extract_lib(char *extDirPath)
{
    ENC_RES_DESC zipDesc;
    FILE *zipFile = NULL;

    zipDesc = get_decode_hex(b64_lib);
    if(zipDesc.status != 0)
    {
        printf("[-] Get ZIP resource failed.\n");
        return EXT_LIB_ERR_RD_RES;
    }
    zipFile = fopen(TEMP_ZIP_NAME, "wb");
    if(zipFile == NULL)
    {
        free(zipDesc.pBufAddr);
        printf("[-] Failed to create ZIP file.\n");
    }
    if(fwrite(zipDesc.pBufAddr, sizeof(char), zipDesc.bufSize, zipFile) <= 0)
    {
        free(zipDesc.pBufAddr);
        fclose(zipFile);
        printf("[-] Write into ZIP file failed.\n");
    }
    fclose(zipFile);
    if(zip_extract(TEMP_ZIP_NAME, extDirPath, _on_extract_entry, NULL) != 0)
    {
        printf("[-] Unzip file failed.\n");
        remove(TEMP_ZIP_NAME);
    }
    remove(TEMP_ZIP_NAME);

    return EXT_LIB_NORMAL;
}





